import React from "react";
import { useFormik } from "formik";
import * as Yup from "yup";

const intialValues = {
  username: "",
  name: "",
  email: "",
  password: "",
  confirmpassword: "",
};
function Login() {
  const formik = useFormik({
    intialValues: intialValues,
    onSubmit: (values) => {
      const formdata = {
        username: values.username,
        email: values.email,
        password: values.password,
      };
      console.log(formdata);
    },
  });

  return (
    <div className="container">
      <div className="headingAndBackButton">
        <h1> Welcome </h1>
        {/* <div style={{ alignItems: "center", display: "flex" }}>
          <button
            onClick={() => {
              navigate("/");
            }}
          >
            Back
          </button>
        </div> */}
      </div>
      <div style={{ paddingLeft: "1rem" }}>
        <p>Login for a seamless experience</p>
      </div>
      <form className="form" onSubmit={formik.handleSubmit}>
        <div className="fields fields--2">
          <label className="field">
            <span className="field__label" htmlFor="username">
              User Name:
            </span>
            <input
              className="field__input"
              type="text"
              id="username"
              name="username"
              value={formik.values.username}
              onChange={formik.handleChange}
            />
            {formik.errors.username && formik.touched.username ? (
              <p>{formik.errors.username}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="name">
              Name:
            </span>
            <input
              className="field__input"
              type="text"
              id="name"
              name="name"
              value={formik.values.name}
              onChange={formik.handleChange}
            />
            {formik.errors.name && formik.touched.name ? (
              <p>{formik.errors.name}</p>
            ) : null}
          </label>
        </div>
        <label className="field">
          <span className="field__label" htmlFor="email">
            Email :
          </span>
          <input
            className="field__input"
            type="text"
            id="email"
            name="email"
            value={formik.values.email}
            onChange={formik.handleChange}
          />
          {formik.errors.email && formik.touched.email ? (
            <p>{formik.errors.email}</p>
          ) : null}
        </label>
        <div className="fields fields--2">
          <label className="field">
            <span className="field__label" htmlFor="password">
              password
            </span>
            <input
              className="field__input"
              type="text"
              id="password"
              name="password"
              value={formik.values.password}
              onChange={formik.handleChange}
            />
            {formik.errors.password && formik.touched.password ? (
              <p>{formik.errors.password}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="number">
              Contact no.:
            </span>
            <input
              className="field__input"
              type="number"
              id="number"
              name="number"
              value={formik.values.number}
              onChange={formik.handleChange}
            />
            {formik.errors.number && formik.touched.number ? (
              <p>{formik.errors.number}</p>
            ) : null}
          </label>
        </div>
        <div className="fields fields--3">
          <label className="field">
            <span className="field__label" htmlFor="zipcode">
              Zip code
            </span>
            <input
              className="field__input"
              type="number"
              id="zipcode"
              name="zipcode"
              value={formik.values.zipcode}
              onChange={formik.handleChange}
            />
            {formik.errors.zipcode && formik.touched.zipcode ? (
              <p>{formik.errors.zipcode}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="city">
              City
            </span>
            <input
              className="field__input"
              type="text"
              id="city"
              name="city"
              value={formik.values.city}
              onChange={formik.handleChange}
            />
            {formik.errors.city && formik.touched.city ? (
              <p>{formik.errors.city}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="state">
              State
            </span>
            <select
              className="field__input"
              id="state"
              name="state"
              onChange={formik.handleChange}
              value={formik.values.state}
            >
              {indianStates.map((state) => {
                return (
                  <option value={state.value} key={state.value}>
                    {state.name}
                  </option>
                );
              })}
            </select>
          </label>
        </div>
        <div className="outer-div-button-continue">
          <button type="submit" className="continueButton">
            Continue
          </button>
        </div>
      </form>
    </div>
  );
}
export default Login;
